import{_ as i,c as a,o as e,ae as r}from"./chunks/framework.Dh1jimFm.js";const d=JSON.parse('{"title":"前端面试","description":"","frontmatter":{},"headers":[],"relativePath":"article/前端面试/面试/面试官-2022-10-12.md","filePath":"article/前端面试/面试/面试官-2022-10-12.md","lastUpdated":1743859882000}'),t={name:"article/前端面试/面试/面试官-2022-10-12.md"};function o(n,l,u,s,p,h){return e(),a("div",null,l[0]||(l[0]=[r('<h1 id="前端面试" tabindex="-1">前端面试 <a class="header-anchor" href="#前端面试" aria-label="Permalink to &quot;前端面试&quot;">​</a></h1><blockquote><p>面试时长：整体40-50min</p></blockquote><h2 id="一、面试流程" tabindex="-1">一、面试流程 <a class="header-anchor" href="#一、面试流程" aria-label="Permalink to &quot;一、面试流程&quot;">​</a></h2><h3 id="_1、开场-10min" tabindex="-1">1、开场（10min） <a class="header-anchor" href="#_1、开场-10min" aria-label="Permalink to &quot;1、开场（10min）&quot;">​</a></h3><ul><li><p>寒暄</p><ul><li>哈喽，请问是<strong>练佳玲</strong>对吧？—— 是的</li><li>面试官自我介绍：你好，我是B站企业效率部的前端工程师九二，也是这次的面试官。</li><li>OK，时间差不多了要不我们开始吧~</li></ul></li><li><p>自我介绍</p></li><li><p>熟悉一下（简历亮点或疑惑的点、自我介绍中的点）</p><ul><li>不少项目管理相关的内容，会不会影响开发的进度？开发管理占比大概多少？（5:2.5:2.5）</li><li>介绍一下基于babel.js的自动化测试开发效率工具？ <ul><li>单元测试 更新注释 babel parse代码</li></ul></li><li>React比较多，Vue有了解过吗？</li><li>Base福建，看上海机会</li></ul></li></ul><h3 id="_2、项目考察-10min" tabindex="-1">2、项目考察（10min） <a class="header-anchor" href="#_2、项目考察-10min" aria-label="Permalink to &quot;2、项目考察（10min）&quot;">​</a></h3><ul><li>介绍下最有成就感或有技术含量的项目？（1-2个） <ul><li>自动化测试库：参与迁移工作</li><li>AWS项目（偏后台）：集成在微软平台中，调用aws方法 python</li></ul></li><li>一共多少人参与，你参与的部分？</li></ul><h3 id="_3、技术点考察-20min" tabindex="-1">3、技术点考察（20min） <a class="header-anchor" href="#_3、技术点考察-20min" aria-label="Permalink to &quot;3、技术点考察（20min）&quot;">​</a></h3><ul><li><p>基础</p><ul><li>JS <ul><li>如何区分array object <ul><li><code>isArray(ES5有兼容性问题)</code></li></ul></li><li>对象 <ul><li>Object.assign</li></ul></li><li>数组方法： <ul><li>forEach</li><li>reduce(pre,curr, () =&gt; {})</li></ul></li><li>原型链：<code>a._proto_ = Object.prototype</code></li></ul></li><li>CSS <ul><li>CSS盒模型（box-sizing：content-sizing、border-sizing）</li><li>CSS定位</li><li>移动端适配：<code>没有做过移动端</code>、rem</li></ul></li><li>浏览器 <ul><li>浏览器从输入 url 到页面展示的过程 <ul><li>DNS解析</li><li>DOM树、CSS render布局树、渲染树</li><li>重绘 &gt; 重排</li></ul></li><li>EventLoop <ul><li>宏任务：new promise</li><li>微任务：promise.then(() =&gt; {})</li></ul></li><li>http缓存机制： <ul><li>强缓存</li><li>协商缓存 304</li></ul></li></ul></li></ul></li><li><p>框架原理</p><ul><li>Vue</li><li>React</li><li>webpack</li></ul></li><li><p>实际开发经验</p><ul><li>性能优化</li><li>之前公司的Git分支规范、CI/CD是怎么做的</li></ul></li><li><p>软技能考察</p><ul><li>为什么学习前端</li></ul></li></ul><h3 id="_4、编码考察-15min" tabindex="-1">4、编码考察（15min） <a class="header-anchor" href="#_4、编码考察-15min" aria-label="Permalink to &quot;4、编码考察（15min）&quot;">​</a></h3><ul><li>对象的扁平化</li><li>无重复字符的最长子串</li><li>括号匹配</li></ul><h3 id="_5、q-a环节-5min" tabindex="-1">5、Q&amp;A环节（5min） <a class="header-anchor" href="#_5、q-a环节-5min" aria-label="Permalink to &quot;5、Q&amp;A环节（5min）&quot;">​</a></h3><p><strong>我这边暂时没有什么要问了，你有想要问我的吗？</strong></p><ul><li>部门业务情况：企业效率部门，主要有人事线（招聘、入转调离、绩效考勤）、业财法、中台支持系统（低代码平台、简历预览），涉及的端：PC、H5、桌面端</li><li>技术栈：Vue3 + TS + 自研组件库和脚手架、低代码平台、Electron桌面端开发</li><li>团队规模：整个部门几百号人，研发大几十号人</li><li>加班情况：10:00 - 19:00 看项目情况加班，整体在互联网行业还是OK的</li></ul><p><strong>如果没有其他问题的话，我们今天的面试就先到这儿，如果有后续的面试安排HR会联系你</strong></p><h2 id="二、考察重点" tabindex="-1">二、考察重点 <a class="header-anchor" href="#二、考察重点" aria-label="Permalink to &quot;二、考察重点&quot;">​</a></h2><p>能力维度</p><ul><li>技术能力：基础技术点、<strong>技术深度</strong>、<strong>技术广度</strong>、<strong>架构能力</strong></li><li>项目能力：对项目的思考</li><li>沟通能力：思路逻辑清晰</li></ul><p>参考：综合能力要求</p><ul><li><strong>数据结构与算法</strong></li><li><strong>前端基础知识</strong></li><li><strong>知识深度</strong></li><li><strong>知识广度</strong></li><li><strong>实际工作经验</strong></li><li><strong>编写高质量代码</strong></li><li><strong>分析和解决问题</strong></li><li><strong>项目设计</strong></li><li><strong>软技能</strong></li></ul><h2 id="三、面试评价" tabindex="-1">三、面试评价 <a class="header-anchor" href="#三、面试评价" aria-label="Permalink to &quot;三、面试评价&quot;">​</a></h2><h3 id="面评框架" tabindex="-1">面评框架 <a class="header-anchor" href="#面评框架" aria-label="Permalink to &quot;面评框架&quot;">​</a></h3><ul><li>面试总评：整体面试不错/一般/不太好，建议定级（如果有<code>+</code> <code>-</code> 的情况，需标明原因）</li><li>亮点：(备注：项目、技术、业务、软技能)</li><li>不足：（备注：项目、技术基础/深度）</li><li>其他考虑点：（备注：选填，如base其他城市/意向不强等）</li></ul><h3 id="面评格式" tabindex="-1">面评格式 <a class="header-anchor" href="#面评格式" aria-label="Permalink to &quot;面评格式&quot;">​</a></h3><p>面试总评：整体面试还可以，建议定级2-1+ 1、广度不错，基础问题总体答的还可以，有后端开发经验；技术深度和技术敏感度不太够，原型链、react的问题答的不太好 2、项目中有写过提效工具库，不过没有做过移动端H5，Vue也不太了解 3、总体沟通比较顺畅 4、算法题没有写出来，基本思路基本OK 其他考虑点： 1、Base福建，看上海机会，不一定来</p><h2 id="四、回顾小结" tabindex="-1">四、回顾小结 <a class="header-anchor" href="#四、回顾小结" aria-label="Permalink to &quot;四、回顾小结&quot;">​</a></h2><p>面试前：</p><ul><li>提前定会议室，或提前半小时找电话亭</li></ul><p>面试中：</p><ul><li>因为原本的面试官抽不开身，我这边是临时接到的面试任务，作为这次的面试官，让你久等了真是抱歉。</li></ul><p>面试后：</p><ul><li>面评10分钟内写完，不纠结</li></ul><p>总体标准</p><ul><li>5分以下淘汰</li><li>6分待定</li><li>7/8分以上通过</li></ul><p>具体打分</p><ul><li><p>项目（30%）</p></li><li><p>基础 （40%）</p></li><li><p>算法题 （30%）</p></li><li><p>总分（10分）：</p></li></ul>',36)]))}const m=i(t,[["render",o]]);export{d as __pageData,m as default};
